import React, { Component } from 'react';
import './App.css';
import HeaderForm from './header/header';
import {BrowserRouter, Route} from 'react-router-dom'
import HomeForm from './main/main';

class App extends Component {


  render(){
  return (
    <BrowserRouter>

    <div className="App">


   <HeaderForm />
   <Route exact path="/home" component= {HomeForm} />


</div>

    </BrowserRouter>

    );
}}

export default App;
